import React, { useState, useEffect } from 'react';
import Product from './Product';

function App() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Qui andrebbe la logica per recuperare i prodotti 
    // da un database o file JSON 
    const sampleProducts = [
      {
        imageUrl: 'https://picsum.photos/200/300?random=1',
        name: 'T-shirt con stampa Gufo',
        description: 'Comoda t-shirt in cotone...',
        price: '€ 20,00'
      },
      // ...altri oggetti prodotto
    ];
    setProducts(sampleProducts);
  }, []);

  return (
    <div className="App">
      <div className="products-grid">
        {products.map((product) => (
          <Product
            key={product.name} // Usa una key unica (id del prodotto ideale)
            imageUrl={product.imageUrl}
            name={product.name}
            description={product.description}
            price={product.price}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
